import React from 'react';
import RouteTable from './Routes/Routes';
import { CartProvider } from './Context/CartContext';



function App() {
  return (
    <GoogleOAuthProvider clientId={GOOGLE_CLIENTID}>...
    <CartProvider>
      <RouteTable />
    </CartProvider>
    </GoogleOAuthProvider>
  );
}

export default App;
